import React from 'react';
import { Row, Col } from 'antd';

import './App.css';
import Logo from './assets/logo.svg.png';

function App() {
  return (
    <div className="App">




      {/* Heading */}

      <Row>
        <Col span={24}>
          <ul>
            <li>
              <img src={Logo} alt="" width={80}/>
            </li>
            <li>
              <h1>cổng thông tin hành chính xã Thanh Đạt</h1>
            </li>
            <li>
              <div className="boxBtn">
                <button>Đăng nhập</button>
                <button>Đăng ký</button>
              </div>
            </li>
          </ul>
        </Col>

      </Row>


      {/* NavBar */}



      {/* Body */}





      {/* Footer */}




    </div>
  );
}

export default App;
